import './App.css';
import {  BrowserRouter, Routes,Route} from 'react-router-dom'
import { Login } from './component/login';
import Home from './component/home';


function App() {
  const h ="home" 
  const r =<Route path={h} element={<Home/>}/>
  return (
    <BrowserRouter>
    <Routes>
      <Route path='/' element={<Login/>}/>
      {r}
    </Routes>
    </BrowserRouter>
  );
}

export default App;
